motif = "GTTTCAATTATT"
text = ""
maxMismatches = 5

count = 0
mismatchLoc = []
for i in range(0, (len(text) - len(motif) + 1)):
    count = 0
    for j in range(0, len(motif)):
        
        if text[j + i] != motif[j]:
            count += 1
        if count > maxMismatches:
            break
    if count <= maxMismatches:
        mismatchLoc.append(i)


stringInts = [str(i) for i in mismatchLoc]
parse = " ".join(stringInts)
print(parse)